	public function testEscapeOutput()
	{
		$_POST["var1"]="'Ola'";
		Miscellaneous::escapeInput();
		$this->assertEquals($_POST["var1"], '\'Ola\'');
		
		//verifying that array variables are also escaped
		$_POST = array();
		$_POST['names'] = array("'Jason'", "'Kofi'");
		$expected = array('\'Jason\'', '\'Kofi\'');
		Miscellaneous::escapeInput();
		$this->assertEquals($expected, $_POST['names']);
	}

